“Укрзализныця” в марте-апреле скорректировала расписание движения ряда поездов дальнего следования, а также запланировала дополнительные рейсы перед летним сезоном перевозок, запуск которых будет зависеть от эпидемиологической ситуации в стране.
Об этом сообщила пресс-служба компании.
В частности, “Укрзализныця” добавила в расписание поезда:
№77/78 Харьков — Мариуполь;
№119/120 Львов — Запорожье;
№719/720 Харьков — Киев;
увеличила периодичность курсирования поезда №19/20 Попасная — Киев (по четным дням недели).
В то же время, в связи с низким спросом на перевозки во время карантина, принято решение временно отменить количество рейсов в Западную Украину:
с 13 апреля — № 29/30 Киев-Ужгород (курсировало 6 вагонов из 9 вагонов, населенность на 11-25 апреля — 2%);
с 13 апреля — № 5/6 Ужгород-Херсон (6 вагонов с 10 населенностью с 11 по 25 апреля — менее 1%);
с 14 апреля — № 243/244 Киев-Рахов (11 вагонов из 18, населенность с 11 по 25 апреля — 7%).
По причинам экономической необоснованности с текущей недели меняется периодичность курсирования поездов: №773/774 Киев — Шостка: три раза в неделю (вместо 5 раз в неделю) и №781/782 Киев — Черкассы: три раза в неделю (вместо 5 раз в неделю ).
Ранее сообщалось, что “Укрзализныця” приостанавливает продажу билетов на Буковину и в Житомирской области, которые оказались в “красной зоне” карантина.
